def set_plot_env(rewards_dict, exp_name):

    plt.figure(figsize=(10,5))
    style = "whitegrid"
    sns.set_theme(style=style) # background color
    ax = plt.gca()

    # rewards_dist {'name':[], 'rewards]':[]}
    color_list = ['b', 'r', 'y', 'g', 'm', 'k', 'b-.', 'r-.', 'y-.']

    # color_list = ['b-o', 'r-o', 'y-o', 'b-s', 'r-s', 'y-s', 'b-^', 'r-^', 'y-^']
    for idx, name in enumerate(rewards_dict['name']):
        plot_reward(ax, rewards_dict['rewards'][idx], name, color=color_list[idx]) #color_list[idx]

    # ax.legend(loc='center right')
    # plt.legend(bbox_to_anchor=(1.05, 1), loc='upper left')
    plt.legend()
    ax.set_xlabel('Iterations')
    ax.set_ylabel('Reward')
    ax.set_title('reward of ' + exp_name +' experiment')

    exp_dir = 'plots/'
    if not os.path.exists(exp_dir):
        os.makedirs(exp_dir)
    plt.savefig(fname=exp_dir + 'figure-2_' + exp_name + '.png', format='png', dpi=1000,  bbox_inches='tight')

    plt.show()


def plot_reward(ax, rewards, name, color):
    rewards = np.array(rewards)
    iterations = np.arange(rewards.shape[0])
    # ax.plot(iterations, rewards, label=name)
    ax.plot(iterations, rewards, color=color, label=name)


